import React from 'react'

class App extends React.Component{

    state = {
        name: 'Ryu',
        age: 30
    }

    handleChange = (e) => {
        this.setState({
            name: e.target.value
        })
    }

    render() {
        return (
            <div>
                <h1>My name is {this.state.name} </h1>
                <form>
                    <input type="text" onchange={this.handleChange} />
                    <button onsu>Submit</button>
                </form>
            </div>
        )
    }
}
export default App;
